import React, { useEffect, useState } from 'react';
import './App.css';

interface MilkInformation {
  count: string;
  name: number;
}

function App() {
  const [MilkData, setMilkData] = useState<MilkInformation[]>([]);

  useEffect(() => {
    const getData = async () => {
      const response = await fetch("http://localhost:5136/api");
      const MilkResults = await response.json();
      setMilkData(MilkResults);
    }
    getData();
  }, [])

  return (
    <div>
      <h1>{MilkData.length}</h1>
      {MilkData.map(m =>
        <ul>
          <li>{m.count}</li>
          <li>{m.name}</li>
        </ul>
      )}
    </div>
  );
}

export default App;
